  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Section 4104 of the Patient Protection
  and Affordable Care Act  waives previous cost-sharing requirements for many Medicare-covered
  preventive services. In 1997, Congress passed similar legislation waiving the deductible
  only for mammograms and Pap smears. The purpose of this study is to examine the
  effect of the deductible waiver on mammogram and Pap smear utilization rates.</p>n\",\n\t\"license_title\":
